INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('3af2af25-6559-b245-9d96-89c498ae8b47', '2024-05-15 08:50:49', '544.50', 'BIABJ1ZS', 'Vita vexetur, ob eumque errorem et voluptatibus maximis saepe priventur et durissimis animi doloribus torqueantur, sapientia est adhibenda.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('84e606ea-dc9a-bef1-da7d-75ae95cc7a65', '2024-03-13 06:08:10', '605.72', 'dealerC', 'In geometriaque perfecto, huic pedalis fortasse; tantum enim esse omnino in nostris poetis aut inertissimae segnitiae est aut in dolore, sed in his rebus instructus semper est in quo etiam Democritus haeret, turbulenta concursio hunc mundi ornatum efficere non poterit. Ne illud quidem physici, credere aliquid esse minimum, quod profecto numquam putavisset.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('52f74e8a-7ea1-9920-292b-3d6fed1d4f98', '2024-12-20 10:33:23', '395.04', 'BIABJ1ZS', 'Quid ego intellegerem, sed quid probarem. Quid igitur est? Inquit; audire enim cupio, quid non probes eius, a quo dissentias. Quid enim me prohiberet Epicureum esse, si probarem, quae ille diceret? Cum praesertim illa perdiscere ludus esset. Quam ob rem tandem, inquit, non satisfacit? Te enim iudicem aequum.');
