INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('9557c995-eaa8-541a-cb8c-f6034a7c0c76', '2024-01-26 15:48:01', '525.50', 'dealer0', 'Et consuetudinum instituendarum voluntates fieri propter voluptatem; cum autem usus.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('6fdd47cc-ecb7-a9ad-c2a8-99bfcf332f68', '2024-05-04 11:44:19', '534.52', 'dealer0', 'Eae semper voluptatibus inhaererent, eadem de amicitia dicenda sunt. Praeclare enim Epicurus his paene verbis.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('8e64b98f-a89e-bc12-d481-a9cb8d2433f4', '2024-07-23 18:59:05', '447.91', 'dealer1', 'Naturae, si tota oratio nostra omnem sibi fidem sensibus confirmat, id est incorruptis atque integris testibus, si infantes pueri, mutae etiam bestiae paene loquuntur magistra ac duce natura.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('f92c73b7-55e7-e48a-aff3-06d12b7c251f', '2024-02-13 13:47:43', '602.10', 'dealerF', 'Quae velim. An me, inquam, nisi te audire vellem, censes haec dicturum fuisse? Utrum igitur percurri omnem Epicuri disciplinam placet an de una voluptate quaeri, de qua omne certamen est? Tuo vero id quidem, inquam, arbitratu. Sic faciam igitur, inquit: unam rem explicabo, eamque.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('30994be8-420c-be4e-6fec-33d1aa26eeb9', '2024-04-13 19:38:23', '605.75', 'dealerC', 'Est; si vero molita quippiam est, quamvis occulte fecerit, numquam tamen id volunt fieri, difficilem quandam temperantiam postulant in eo, quod semel admissum coerceri reprimique non potest, ut propemodum iustioribus utamur illis, qui omnino avocent a philosophia, quam his, qui rebus infinitis.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('38c989ce-8aef-a461-58f5-4f54e38cafdf', '2024-07-11 15:05:26', '604.21', 'dealer1', 'Omittantur maiorum voluptatum adipiscendarum causa aut dolores suscipiantur maiorum dolorum effugiendorum gratia. Sed de clarorum hominum factis illustribus et gloriosis satis hoc loco dictum sit. Erit enim iam de omnium virtutum cursu ad voluptatem proprius disserendi locus. Nunc autem explicabo, voluptas ipsa quae qualisque sit, ut tollatur error omnis imperitorum intellegaturque ea.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('d06e726c-886f-58b8-7ef3-11a61d1ca8a1', '2024-04-13 13:12:16', '554.01', 'dealer0', 'Verterem Platonem aut Aristotelem, ut verterunt nostri poetae fabulas, male, credo, mererer.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('e68011b9-9791-3937-bada-2003a16bda3d', '2024-02-24 23:41:15', '529.45', 'dealerC', 'Et tamen ego a philosopho, si afferat eloquentiam, non asperner, si non habeat, non admodum flagitem. Re mihi non aeque satisfacit, et quidem locis pluribus. Sed quot homines, tot sententiae; falli igitur possumus. Quam ob rem voluptas expetenda, fugiendus dolor sit. Sentiri haec putat.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('5fd40a34-916b-293e-7006-2aa67e3565ab', '2024-07-06 10:08:43', '609.79', 'dealerF', 'Minus amicos quam se ipsos diligant. Quod et posse fieri intellegimus et saepe disserui, Latinam linguam non modo nullam captet, sed etiam quid a singulis philosophiae disciplinis.');
