INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('0e2f4b7f-23c6-afaa-b99c-53f398c466b8', '2024-07-03 14:45:30', '575.59', 'dealer0', 'Vivere. Quae est enim in vita tantopere quaerendum quam cum omnia in philosophia, tum id, quod sentiant non esse faciendum, ii voluptatem maximam adipiscuntur praetermittenda voluptate. Idem etiam dolorem saepe perpetiuntur, ne, si id non faciant, incidant in maiorem. Ex quo efficiantur ea, quae.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('10661a6c-aaa0-09e1-a8f8-c866f3b584fc', '2024-03-18 07:41:07', '583.29', 'BIABJ1ZS', 'Quodsi vitam omnem perturbari videmus errore et inscientia, sapientiamque esse solam, quae.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('36dbc0a5-22af-66dd-4699-59db41dc58f9', '2024-02-10 00:25:59', '532.68', 'dealer1', 'Et excelsus omni est liber cura et angore, cum et tibi probatus videretur et iis, quos ego posse iudicare arbitrarer, plura suscepi veritus ne movere hominum studia viderer, retinere non posse. Qui autem.');
