INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('9102d5c1-324a-7ead-1fd9-0c8dde89cb20', '2024-05-29 07:57:10', '502.40', 'dealer1', 'Fieri possit, ut ab ea nullo modo sine amicitia firmam et perpetuam iucunditatem vitae.');
