INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('7bbb3197-efd7-667c-4048-b5bc21fbf815', '2024-03-24 00:19:54', '468.33', 'dealer0', 'Primum erit hoc quasi, provincias atomis dare, quae recte, quae oblique ferantur, deinde eadem illa constituto veri a.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('139ef1e6-89db-40cd-8f78-37106bdf332c', '2024-06-27 14:10:15', '434.60', 'dealerC', 'Vitam omnem perturbari videmus errore et inscientia, sapientiamque esse solam, quae nos vocet ad se et alliciat suapte natura, non potest esse dubium, quin id sit summum atque extremum bonorum omnium, beateque vivere nihil aliud sit nisi cum voluptate conectitur.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('19232dc2-2e90-7af7-8315-151a79195d1e', '2024-10-28 20:26:02', '518.35', 'BIABJ1ZS', 'Te, quoquo modo loqueretur, intellegere.');
