INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('082b2e96-cfae-3fba-6af1-0faa96b783d8', '2024-03-22 10:57:26', '509.03', 'dealerF', 'Vult. Nam et complectitur verbis, quod vult, et dicit plane, quod intellegam; et tamen in quibusdam neque pecuniae modus est neque honoris neque imperii nec libidinum nec epularum nec reliquarum cupiditatum, quas nulla praeda umquam improbe.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('35453c9b-0c8a-0e4c-0372-951014dc5ba6', '2024-02-17 16:02:13', '548.93', 'dealer0', 'Imperii nec libidinum nec epularum nec reliquarum cupiditatum, quas nulla.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('e498eafd-ed21-4a8a-a8f4-89b936693cbb', '2024-04-14 10:42:31', '532.03', 'dealer0', 'Potitur, ut animadvertat quanta sint ea quamque iucunda, neque pendet ex futuris, sed expectat illa, fruitur praesentibus ab iisque vitiis, quae paulo ante cum memoriter, tum etiam erga nos amice et benivole collegisti, nec me tamen.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('543eca4a-6438-e0d9-8aae-14826f1ecaaa', '2024-09-13 09:00:46', '384.25', 'BIABJ1ZS', 'Disputatione, quam ob rem voluptas expetenda, fugiendus dolor sit. Sentiri haec putat, ut calere ignem, nivem esse albam, dulce mel. Quorum nihil oportere exquisitis rationibus confirmare, tantum satis esse admonere. Interesse enim inter argumentum conclusionemque rationis et inter mediocrem animadversionem.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('a4420dbb-d1e9-44a6-6e4d-4c4cfa1034c8', '2024-04-23 00:07:31', '506.47', 'dealer0', 'Non asperner, si non habeat, non admodum flagitem. Re.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('94ff97cf-c0f1-3fe9-18f2-d6661f20b3f6', '2024-04-19 21:23:23', '601.34', 'dealer1', 'Malit quam deserere ullam officii partem, ad ea, quae senserit ille, tibi non vera videantur. Vide, quantum, inquam, fallare, Torquate. Oratio me istius philosophi non offendit; nam et laetamur amicorum laetitia aeque atque nostra et pariter dolemus angoribus. Quocirca eodem modo sapiens erit affectus erga amicum, quo in se ipsum, quosque labores propter suam voluptatem susciperet.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('62e5e359-457c-237b-e9cf-6b11ddba8b23', '2024-05-17 04:49:04', '379.17', 'dealerC', 'Venisset, pauca primo inter nos ea, quae senserit ille, tibi non vera videantur. Vide, quantum, inquam, fallare, Torquate. Oratio me.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('03535790-1c43-4af4-fb2a-a5c9746ead74', '2024-12-04 00:07:58', '426.15', 'BIABJ1ZS', 'Possumus, animo autem et laetitiam nobis voluptas animi et corporis voluptatibus, videtisne quam nihil praetermittatur quod vitam adiuvet, quo facilius id, quod maxime placeat, facere possimus, omnis voluptas assumenda est, omnis dolor repellendus.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('b0c539ef-304b-9a92-1126-e34906e8ef22', '2024-05-30 08:04:38', '534.65', 'dealer0', 'Quid et quale sit id, de quo Lucilius: ''ferreum scriptorem'', verum, opinor, scriptorem tamen, ut legendus sit. Rudem enim esse omnino in nostris poetis aut inertissimae segnitiae est.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('2ad40eb8-8a95-64eb-198e-dee6ec0eb15e', '2024-07-01 15:45:54', '532.79', 'BIABJ1ZS', 'Ab iisque M. Brutus dissentiet -- quod et scripta multa sunt, sic inprobitas si cuius in mente consedit, hoc ipso, quod adest, turbulenta est; si vero molita.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('6e6c0c31-5745-32b8-18dc-d55ff366d891', '2024-09-10 19:37:11', '520.56', 'dealerF', 'Quid probarem. Quid igitur est? Inquit; audire enim cupio, quid non probes.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('3c8727ce-829f-23cf-c3fd-9387b5e71121', '2024-03-16 11:16:53', '501.13', 'BIABJ1ZS', 'Extremum, quid ultimum, quo sint omnia bene vivendi recteque faciendi.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('da241159-9194-4009-5017-723121739c1f', '2024-08-23 18:42:09', '481.98', 'BIABJ1ZS', 'Aut pertinacia recte disputari potest. Sed ad haec, nisi molestum est, habeo quae velim. An me, inquam, nisi te audire vellem, censes haec dicturum fuisse? Utrum igitur percurri omnem Epicuri disciplinam placet an de una voluptate quaeri, de qua Epicurus.');
INSERT INTO payment(payment_id, pay_date, amount, dealer_id, remark) VALUES ('280bf4ec-bf9e-65cc-5297-84b1ff542a53', '2024-01-28 18:02:13', '622.56', 'dealer0', 'Honeste iusteque vivatur, nec sapienter, honeste, iuste, nisi iucunde. Neque enim civitas in seditione beata esse.');
